'''雪未來2016'''是[[雪未來]]的2016版本，[[雪未來]]自2010年誕生以來，每年都有一個新形象，2015年官方為徵集新形象展開活動。

勝出形象是'''御伽こたつ'''設計的雪未來形象。寵物雪音兔同樣是'''御伽こたつ'''設計的形象勝出。

== 簡介 ==
「Good Smile Company×piapro」舉行的形象募集活動時間為2015年4月16日到2015年5月11日。

主題為「冬季運動為聯想」（{{lj|北海道の冬を楽しむウインタースポーツ”がテーマ！}}）。限定加入針織帽元素<ref>[http://weibo.com/2462905490/Ceh1dCVZO 初音未来CryptonFutureMedia新浪微博博文]</ref>。

